"use strict";var timeline=[{title:"Departemen Pariwisata, Pos, dan Telekomunikasi (Depparpostel)",tahun:"<i>(1983-1998)</i>",desc:'\n                    <div class="special-image mr-3">\n                        <img src="assets/img/timeline-modal1.png">\n                        <div><small>Lorem ipsum</small></div>\n                    </div>\n                    <p>\n                    Sejarah Kementerian Pariwisata sendiri dimulai pada 1983. Dalam kabinet Pembangunan IV, Presiden Soeharto membentuk Departemen Pariwisata, Pos dan Telekomunikasi (Depparpostel) dengan Menteri Achmad Tahir.\n                    </p>\n                    \n                    <p>\n                        Pada masa itu, untuk memudahkan wisatawan berkunjung ke Indonesia, pemerintah menetapkan bebas visa untuk 26 negara dan 9 bandara dan 7 pelabuhan laut sebagai pintu masuk wisatawan. Pengusaha jasa pariwisata dan perajin pun mulai bergeliat.\n                    </p>\n               \n                    \n                    <p>\n                        Tahun 1988, tongkat estafet jabatan Menparpostel pindah tangan ke Soesilo Soedarman. Seosilo menjabat hingga 1993. Di bawah kepemimpinannya, banyak terobosan yang ia buat. Di antaranya program Sapta Pesona yang masih bergaung hingga sekarang dan kampanye\n                        Visit Indonesia Year 1991.\n                    </p>\n                    \n                    <p>\n                        Pada 1990, pemerintah mengesahkan Undang-undang tentang Kepariwisataan No. 9 Tahun 1990. Pembangunan industri pariwisata Indonesia mulai dilakukan dengan berdasarkan landasan hukum yang kuat.\n                    </p>\n                    \n                    <p>\n                        Di tahun berikutnya atau 1991, Visit Indonesia Year atau VIY dicanangkan untuk pertama kali. Ini merupakan upaya pemerintahan Orde Baru mempromosikan Indonesia di kancah industri pariwisata dunia.\n                    </p>\n                    \n                    <p>\n                        Tahun 1992, berbarengan dengan Visit Indonesia Year 1992, pemerintah meluncurkan pula Visit Indonesia Decade atau Dekade Kunjungan Indonesia. Di era 90-an ini, Visit Indonesia Year dihelat setiap tahun dengan mengusung tema beragam, di antaranya:\n                    </p>\n                    <ul>\n                        <li>1993 - Tahun Lingkungan Hidup</li>\n                        <li>1994 - Tahun Peran Wanita dalam Pembangunan, Pemuda dan Olahraga</li>\n                        <li>1995 - 50 Tahun Peringatan Kemerdekaan Republik Indonesia</li>\n                        <li>1996 - Tahun Bahari dan Dirgantara</li>\n                        <li>1997 - Tahun Telekomunikasi</li>\n                        <li>1998 - Tahun Seni dan Budaya</li>\n                        <li>1999 - Tahun Kriya dan Rekayasa</li>\n                        <li>2000 - Tahun Pemanfaatan Teknologi untuk Peningkatan Kualitas Hidup</li>\n                    </ul>\n                    <p>\n                        Sepanjang dekade tersebut, Indonesia makin banyak mendapat kepercayaan untuk menyelenggarakan acara internasional dan terlibat dalam promosi budaya ke berbagai negara di dunia.\n                    </p>'},{title:"Departemen Pariwisata, Seni dan Budaya (Depparsenibud)",tahun:"(1998-1999)",desc:"Pada masa ini, jabatan Menteri Pariwisata, Seni dan Budaya dipegang oleh Marzuki Usman dalam Kabinet Reformasi Pembangunan yang dibentuk oleh Presiden B.J. Habibie."},{title:"Kementerian Negara Pariwisata dan Kesenian (Kemengparsen)",tahun:"(1999-2001)",desc:"<p>Saat lembaga ini bernama Kementerian Negara Pariwisata dan Kesenian, ada dua orang yang menduduki kursi menteri. Yakni Hidayat Jaelani sejak 1999 hingga 2000 dan I Gede Ardhika sejak 2000 hingga 2001. Keduanya dilantik oleh Presiden Abdurrahman Wahid. Pada 2000 saat jabatan presiden digantikan oleh Megawati Soekarnoputri, I Gede Ardhika bertahan pada posisinya.</p><p>Di tahun 2001, nama kementerian diganti menjadi Kementerian Negara Kebudayaan dan Pariwisata.</p>"},{title:"Kementerian Negara Kebudayaan dan Pariwisata (Kemenegbudpar)",tahun:"(2001-2005)",desc:"<p>Dinamika pariwisata Indonesia berada dalam masa paling berat pasca Bom Bali tahun 2002. Peristiwa tersebut menyebabkan penurunan jumlah kunjungan wisatawan asing ke Bali hingga 32%. Sejumlah insiden pemboman lain (JW Marriot 2003, Kedutaan Besar Australia 2004, Bom Bali 2005, dll) juga menimbulkan dampak serupa. Aksi-aksi terorisme tersebut mengakibatkan sejumlah negara mengeluarkan larangan perjalanan ke Indonesia bagi warga negara masing-masing.</p>"},{title:"Departemen Kebudayaan dan Pariwisata (Depbudpar)",tahun:"((2005-2009))",desc:'\n            <p>Kala itu, tanggung jawab besar dirasakan oleh Menteri Budaya dan Pariwisata Jero Wacik. Pariwisata Indonesia, di bawah komandonya, harus mampu bangkit dari keterpurukan pasca serentetan aksi terorisme yang terjadi di Tanah Air.</p>\n            <div class="special-image mr-3">\n                <img src="assets/img/timeline-modal2.png">\n                <div><small>Lorem ipsum</small></div>\n            </div>\n            <p>Tahun 2008 merupakan titik balik kampanye pariwisata Indonesia dengan kembali digulirkannya Visit Indonesia Year 2008. Pada tahun tersebut, Indonesia memperingati Hari Kebangkitan Nasional yang ke-100. Di bawah kepemimpinan Presiden Soesilo Bambang Yudhoyono dan Menteri Jero Wacik, Departemen Kebudayaan dan Pariwisata mengambil tema Unity in Diversity untuk VIY 2008 dengan anggaran Rp 200 miliar.</p>\n            <p>Bulan Desember tahun itu, Jero Wacik mengatakan bahwa program Visit Indonesia Year 2008 berjalan sukses. Tak hanya target jumlah turis mancanegara yang tercapai, devisa yang diterima negara juga berhasil melampaui target.</p>\n        '},{title:"Kementerian Kebudayaan dan Pariwisata (Kemenbudpar)",tahun:"(2009-2011)",desc:"<p>Saat Presiden SBY dilantik untuk kedua kalinya sebagai presiden tahun 2009, Menteri Jero Wacik juga kembali ke posisinya sebagai Menteri Budaya dan Pariwisata, meski sempat digantikan oleh Mohammad Nuh selama 20 hari.</p>"},{title:"Kementerian Pariwisata dan Ekonomi Kreatif (Kemenparekraf)",tahun:"(2011-2014)",desc:'\n            <div class="special-image mr-3">\n                <img src="assets/img/timeline-modal3.png">\n                <div><small>Lorem ipsum</small></div>\n            </div>\n            <p>Tahun 2011, Kementerian Kebudayaan dan Pariwisata meluncurkan kampanye Wonderful Indonesia. Melalui kampanye ini, sepanjang 2011 menerima kedatangan 6,75 juta wisatawan mancanegara.</p>\n\n            <p>Angka tersebut terus tumbuh di tahun-tahun berikutnya saat posisi Menteri Pariwisata dan Ekonomi Kreatif dijabat oleh Mari Elka Pangestu, menteri perempuan pertama dalam kementerian ini. Jumlah wisatawan mancanegara meningkat jadi 8,04 juta orang di tahun 2012, 8,8 juta di tahun 2013 dan 9,44 juta di tahun 2014.</p>\n            <p>Wonderful Indonesia masih berjalan hingga hari ini. Melalui situs www.indonesia.travel, Kementerian Pariwisata dan Ekonomi Kreatif menyajikan beragam informasi tentang pariwisata di Nusantara. Mulai dari pilihan destinasi dan atraksi wisata menarik, hingga informasi dasar mengenai Indonesia seperti mata uang, iklim, pusat informasi penting, dan lainnya.</p>\n        '},{title:"Kementerian Pariwisata (Kemenpar)",tahun:"(2014-2019)",desc:"<p>Tahun 2015, saat kursi presiden diduduki oleh Presiden Joko Widodo dan Arief Yahya sebagai Menteri Pariwisata, pemerintah memberikan penambahan dana promosi Rp 1,3 triliun untuk sektor pariwisata.</p>\n\n        <p>\n            Kiprah Arief Yahya sebagai Menteri Pariwisata banyak mendapat pujian dan penghargaan, sebab selama periode tersebut pariwisata di Indonesia mengalami sejumlah kemajuan. Ia memperkenalkan 10 Bali Baru untuk mempromosikan daerah tujuan wisata lain di Indonesia kepada turis domestik dan mancanegara.\n        </p>\n        \n        <p>\n            Sejumlah capaian diraih sektor kepariwisataan Indonesia pada masa ini. Salah satunya adalah peringkat daya saing pariwisata Indonesia yang kian meningkat. Pada Travel and Tourism Competitiveness Index (TTCI) yang dikeluarkan oleh World Economic Forum (WEF), Indonesia berada pada peringkat 40 dari 140 negara di tahun 2019, melesat dari peringkat 70 di tahun 2013.\n        </p>\n        "},{title:"Kementerian Pariwisata dan Ekonomi Kreatif (Kemenparekraf)",tahun:"(2019-sekarang)",desc:'<p>Di periode kedua Presiden Jokowi, ia menunjuk tokoh yang namanya besar di dunia penyiaran sebagai pengganti Arief Yahya, yakni Wishnutama Kusubandio. Nama lembaganya pun diubah kembali menjadi Kementerian Pariwisata dan Ekonomi Kreatif.</p>\n\n        <div class="special-image mr-3">\n            <img src="assets/img/timeline-modal4.png">\n            <div><small>Lorem ipsum</small></div>\n        </div>\n        <p>\n        Kini, di bawah kepemimpinan Wishnutama, pengembangan pariwisata Tanah Air difokuskan untuk lebih berorientasi pada kualitas, alih-alih masih memberatkan segi kuantitas. Dari yang semula mengejar angka jumlah kunjungan, sekarang kementerian ini mencurahkan lebih banyak tenaga untuk memberikan pengalaman berkesan bagi wisatawan. Strategi ini diyakini lebihefektif untuk menarik lebih banyak devisa.\n        </p>\n        \n        <p>\n        Tahun 2020, Kemparekraf di bawah Wishnutama menghadapi tantangan yang belum pernah dialami menteri-menteri sebelumnya: pandemi COVID-19. Seketika industri pariwisata harus menunda segala rencana pengembangan. Bahkan tak sedikit pelaku bisnis di sektor ini yang harus kehilangan pekerjaan karena tak ada orang yang berwisata demi mencegah penularan virus mematikan ini.</p>\n\n        <p>Tak menghabiskan waktu terlalu lama berdiam diri, Kemenparekraf mencanangkan program Cleanliness, Health, Safety and Environmental Sustainability (CHSE). Program ini digagas sebagai bentuk adaptasi di bidang pariwisata dan ekonomi kreatif terkait penerapan protokol kesehatan selama pandemi masih melanda -- atau disebut pula era kenormalan baru. CHSE juga menjadi faktor penting dari pengembangan pariwisata agar lebih berkelanjutan.</p>\n        \n        <p>Tahun 2020, Kemenparekraf juga mencanangkan gerakan #BeliKreatifLokal. Gerakan ini bertujuan untuk membantu para pelaku ekonomi kreatif, khususnya subsektor fesyen, kuliner dan kriya agar kembali bangkit dari krisis akibat pandemi COVID-19.</p>\n        \n        <p>Pihak Kemenparekraf menjalankan gerakan ini dengan bekerja sama dengan Blibli, Gojek, Grab, Blue Bird, Bukalapak, Tokopedia, Shopee dan Kontrak Hukum. Dukungan yang diberikan pada para pelaku ekonomi kreatif di antaranya co-branding, penyaluran produk melalui platform transportasi daring dan marketplace terintegrasi, pendampingan konsultasi hukum untuk pendirian badan hukum dan pengurusan sertifikasi Hak Kekayaan Intelektual (HKI).\n        </p>\n        '}];
//# sourceMappingURL=data:application/json;charset=utf-8;base64,